import React from "react";
import {
  VictoryChart,
  VictoryLine,
} from "victory";

function deneme() {
    return (
      <VictoryChart
        theme={VictoryTheme.clean}
      >
        <VictoryLine />
      </VictoryChart>
    );
  }

  export default deneme;
